using System;
using System.Collections.Generic;
using System.Linq;
using System.Security.Cryptography;
using System.Text;
using System.Net;
using System.Net.Mail;

namespace TurboTrend.Business_Layer
{
    public class EmailManager
    {
        private ProjectConfig settings;

        public EmailManager()
        {
            settings = new ProjectConfig();
        }

        private SmtpClient getSmtp()
        {
           return new SmtpClient
            {
                Host = "smtp.gmail.com",
                Port = 587,
                EnableSsl = true,
                DeliveryMethod = SmtpDeliveryMethod.Network,
                UseDefaultCredentials = false,
                Credentials = new NetworkCredential(settings.emailAccountInfo[0], settings.emailAccountInfo[1])
            };
        }

        public void sendInquiry(string sMessage, string sFromEmail)
        { // Sends an inquiry to the turbotrend account
            string sEmail = "<!DOCTYPE html><html><head><meta charset=\"utf-8\" /><title>Support Request</title></head><body><div style=\"background-color: #e6e8eb; margin-top: 1%; padding: 2%;\"><p><noscript>" + sMessage + "</noscript></p></div></div></body></html>";

            MailAddress fromAddr = new MailAddress(settings.emailAccountInfo[0]);
            MailAddress toAddr = new MailAddress(settings.emailAccountInfo[0]);
            MailMessage msg = new MailMessage(fromAddr, toAddr);
            msg.Subject = "Support Request - " + DateTime.Now + " " + sFromEmail;
            msg.Body = sMessage;
            msg.IsBodyHtml = true;

            SmtpClient email = getSmtp();
            email.Send(msg);
        }

        public void sendChangePassword(string sEmail)
        {
            // We remove the . from the email address, otherwise web browsers complain due to thinking the email is a valid web address.
            string sNewEmail = "";
            foreach(char letter in sEmail){ if (letter == '.') {sNewEmail += ',';} else {sNewEmail += letter;} }

            // This link won't work when the date changes
            // We generate a unique key, using the users email and the current day
            string sUniqueKey = hashMethod(sEmail + DateTime.Today);

            string sChangePasswordLink = "http://localhost:51003/userLayer/forgotPassword.aspx?Key=" + sUniqueKey + "&Email=" + sNewEmail;

            string sMsg = "<!DOCTYPE html><html><head><meta charset=\"utf-8\" /><title>Change Your Password Request</title><!--        Emails:        Verification Email        Thanks for Verifying/Welcome        Forgot Password        Password Has Been Reset        Order Received    (footer: view account, shop, contact)    --></head><body><div style=\"background-color: #e6e8eb; margin-top: 1%; padding: 2%;\"><p><strong>Hello " + sEmail + ",</strong></p><p><strong>Change Password Request</strong></p><p>We've recieved a request to change your password <br /> If you'd still like to change your password, click<a href=\"" + sChangePasswordLink + "\" \\>here.</a></p><img style=\"margin-top: 1%; width: 5%;\"src=\"data:image/png;base64,\"><br /><em style=\"margin-top: 1%; margin-left: 1%;\">TurboTrend Management</em><br /><hr style=\"border-top: 2px dotted rgb(60, 90, 166); margin-top: 2%;\" /><em style=\"font-size: smaller;\">Sometimes people make mistakes, so if you have received this email in error, please disregard it.</em><hr style=\"border-top: 2px dotted rgb(60, 90, 166); margin-bottom: 2%;\" /><div style=\"background-color: #e6e8eb; margin-top: 1%;\"><p><a target=\"_blank\" href=\"http://localhost:51003/userLayer/login.aspx\">Login</a> | <a target=\"_blank\" href=\"http://localhost:51003/userLayer/faq.aspx\">FAQ</a> | <a target=\"_blank\" href=\"http://localhost:51003/userLayer/match.aspx\">Search</a></p></div></div></div></body></html>";

            try
            {
                MailAddress fromAddr = new MailAddress(settings.emailAccountInfo[0], "TurboTrend");
                MailAddress toAddr = new MailAddress(sEmail);
                MailMessage msg = new MailMessage(fromAddr, toAddr);
                msg.Subject = "Change Password Request";
                msg.Body = sMsg;
                msg.IsBodyHtml = true;

                SmtpClient email = getSmtp();
                email.Send(msg);
            }
            catch
            {
                // We had an error sending the email....
            }

        }

        public bool checkKey(string sEmail, string sKey)
        {
            string sCompareEmail = "";
            foreach(char letter in sEmail)
            {
                if (letter == ',')
                {
                    sCompareEmail += '.';
                }
                else
                {
                    sCompareEmail += letter;
                }
            }

            string sComparedKey = hashMethod(sCompareEmail + DateTime.Today);
            if (sComparedKey.Substring(0, sKey.Length) == sKey)
            {
                return true;
            }
            return false;
        }


        private string hashMethod(string pwordToHash)
        {
            HashAlgorithm algorithm = new SHA256CryptoServiceProvider();

            Byte[] inputBytes = Encoding.UTF8.GetBytes(pwordToHash);

            Byte[] hashedBytes = algorithm.ComputeHash(inputBytes);

            return BitConverter.ToString(hashedBytes);
        }
    }
}